        Dictionary<string, int> wordDic = new();
        HashSet<(int, int)> hs = new();
        void Kmp(string s, int index)
        {
            string rs = string.Join("", s.Reverse());
            if (s != rs && wordDic.TryGetValue(rs, out int ri))
            {
                hs.Add((ri, index));
                hs.Add((index, ri));
            }
            Span<int> next = stackalloc int[s.Length];
            next[0] = -1;
            for (int i = 1; i < next.Length; ++i)
            {
                int nexti = next[i - 1] + 1;
                while (nexti >= 0 && rs[nexti] != rs[i])
                    nexti = nexti > 0 ? next[nexti - 1] + 1 : -1;
                next[i] = nexti;
            }
            int p = -1;
            for (int i = 0; i < s.Length; ++i)
            {
                ++p;
                while (p >= 0)
                {
                    if (rs[p] == s[i]) break;
                    if (p > 0) p = next[p - 1] + 1;
                    else p = -1;
                }
            }
            while (p >= 0)
            {
                string key = rs.Substring(p + 1);
                if (wordDic.TryGetValue(key, out int ki))
                    hs.Add((index, ki));
                p = next[p];
            }
            for (int i = 1; i < next.Length; ++i)
            {
                int nexti = next[i - 1] + 1;
                while (nexti >= 0 && s[nexti] != s[i])
                    nexti = nexti > 0 ? next[nexti - 1] + 1 : -1;
                next[i] = nexti;
            }
            p = -1;
            for (int i = 0; i < s.Length; ++i)
            {
                ++p;
                while (p >= 0)
                {
                    if (s[p] == rs[i]) break;
                    if (p > 0) p = next[p - 1] + 1;
                    else p = -1;
                }
            }
            while (p >= 0)
            {
                string key = rs.Substring(0, rs.Length - p - 1);
                if (wordDic.TryGetValue(key, out int ki))
                    hs.Add((ki, index));
                p = next[p];
            }
        }
        public IList<IList<int>> PalindromePairs(string[] words)
        {
            for (int i = 0; i < words.Length; i++)
                wordDic[words[i]] = i;
            for (int i = 0; i < words.Length; i++)
            {
                if (words[i] == "") continue;
                Kmp(words[i], i);
            }

            return hs.Select(p => new int[] { p.Item1, p.Item2 } as IList<int>).ToArray();
        }

