        // ver1 不用KMP
        // TLE: 7203ms -> 1766ms 其实还好
        public IList<IList<int>> PalindromePairs_ver1(string[] words)
        {
            Dictionary<string, int> wordDic = new();
            HashSet<(int, int)> hs = new();
            for (int i = 0; i < words.Length; i++)
                wordDic[words[i]] = i;
            for (int i = 0; i < words.Length; i++)
            {
                string s = words[i];
                if (s == "") continue;
                string rs = string.Join("", s.Reverse());
                if (s == rs)
                {
                    if (wordDic.TryGetValue("", out int j))
                    {
                        hs.Add((i, j));
                        hs.Add((j, i));
                    }
                }
                else
                {
                    if (wordDic.TryGetValue(rs, out int j))
                    {
                        hs.Add((i, j));
                        hs.Add((j, i));
                    }
                }
                for (int n = 1; n < s.Length; ++n)
                {
                    bool same = true;
                    for (int x = 0, y = s.Length - n; x < n; ++x, ++y)
                        if (s[x] != rs[y])
                        {
                            same = false;
                            break;
                        }
                    if (same)
                    {
                        string key = rs.Substring(0, rs.Length - n);
                        if (wordDic.TryGetValue(key, out int j))
                            hs.Add((j, i));
                    }
                    same = true;
                    for (int x = 0, y = s.Length - n; x < n; ++x, ++y)
                        if (rs[x] != s[y])
                        {
                            same = false;
                            break;
                        }
                    if (same)
                    {
                        string key = rs.Substring(n);
                        if (wordDic.TryGetValue(key, out int j))
                            hs.Add((i, j));
                    }
                }
            }

            return hs.Select(p => new int[] { p.Item1, p.Item2 } as IList<int>).ToArray();
        }
